import React from 'react';

const ImageComponent = ({ imageUrl, altText ,style}) => {
  return (
    <div style={{ margin: '8px', padding: '8px', border: '1px solid #ddd' }}>
      <img
        src={imageUrl}
        alt={altText}
        // style={{ maxWidth: '100%', maxHeight: '100%',objectFit:'contain',flex: '1'}}

      />
    </div>
  );
};

export default ImageComponent;
